    // ä»æ± ä¸­å–å‡ºä¸€ä¸ªç°æˆçš„ç²’å­ï¼ˆæœ€ä½³æƒ…å†µï¼‰\r\n      particle = this.pool.pop();\r\n      particle.userData.reuseCount++;\r\n      this.stats.reused++;\r\n      \r\n    } else if (this.activeParticles.length < this.maxSize) {\r\n      // æ± ç©ºäº†ä½†è¿˜æ²¡è¾¾åˆ°æœ€å¤§é™åˆ¶ï¼Œåˆ›å»ºæ–°çš„ç²’å­\r\n      particle = this.createNewParticle();\r\n      this.stats.created++;\r\n      console.log(`ParticlePool: æ± å·²ç©ºï¼Œåˆ›å»ºæ–°ç²’å­ (æ€»åˆ›å»ºæ•°: ${this.stats.created})`);\r\n      \r\n    } else {\r\n      // è¾¾åˆ°æœ€å¤§é™åˆ¶ï¼Œå¼ºåˆ¶å›æ”¶æœ€è€çš„ç²’å­\r\n      particle = this.activeParticles.shift();\r\n      console.warn(`ParticlePool: è¾¾åˆ°æœ€å¤§å®¹é‡ ${this.maxSize}ï¼Œå¼ºåˆ¶å›æ”¶æœ€è€ç²’å­`);\r\n    }\r\n    \r\n    // é‡ç½®ç²’å­çŠ¶æ€\r\n    this.resetParticle(particle);\r\n    \r\n    // è®¾ç½®ä¸ºå¯è§å¹¶åŠ å…¥æ´»è·ƒåˆ—è¡¨\r\n    particle.visible = true;\r\n    this.activeParticles.push(particle);\r\n    \r\n    // æ›´æ–°ç»Ÿè®¡\r\n    this.stats.maxActive = Math.max(this.stats.maxActive, this.activeParticles.length);\r\n    \r\n    return particle;\r\n  }\r\n  \r\n  /**\r\n   * å°†ç²’å­å½’è¿˜åˆ°å¯¹è±¡æ± \r\n   * @param {THREE.Mesh} particle - è¦å½’è¿˜çš„ç²’å­å¯¹è±¡\r\n   */\r\n  releaseParticle(particle) {\r\n    if (!particle) return;\r\n    \r\n    const index = this.activeParticles.indexOf(particle);\r\n    if (index === -1) {\r\n      console.warn('ParticlePool: å°è¯•é‡Šæ”¾æœªåœ¨æ´»è·ƒåˆ—è¡¨ä¸­çš„ç²’å­');\r\n      return;\r\n    }\r\n    \r\n    // ä»æ´»è·ƒåˆ—è¡¨ä¸­ç§»é™¤\r\n    this.activeParticles.splice(index, 1);\r\n    \r\n    // é‡ç½®ç²’å­çŠ¶æ€\r\n    this.resetParticle(particle);\r\n    particle.visible = false;\r\n    \r\n    // å½’è¿˜åˆ°æ± ä¸­\r\n    this.pool.push(particle);\r\n    this.stats.released++;\r\n  }\r\n  \r\n  /**\r\n   * é‡ç½®ç²’å­çŠ¶æ€\r\n   * @param {THREE.Mesh} particle - è¦é‡ç½®çš„ç²’å­\r\n   */\r\n  resetParticle(particle) {\r\n    // é‡ç½®ä½ç½®\r\n    particle.position.set(0, 0, 0);\r\n    \r\n    // é‡ç½®æ—‹è½¬\r\n    particle.rotation.set(0, 0, 0);\r\n    \r\n    // é‡ç½®ç¼©æ”¾\r\n    particle.scale.set(1, 1, 1);\r\n    \r\n    // é‡ç½®æè´¨å±æ€§\r\n    if (particle.material) {\r\n      particle.material.opacity = CONFIG.demoAnimation?.electronParticle?.opacity || 0.8;\r\n      particle.material.color.setHex(CONFIG.beam?.color || 0x00ffff);\r\n    }\r\n    \r\n    // åœæ­¢æ‰€æœ‰æ­£åœ¨è¿›è¡Œçš„åŠ¨ç”»\r\n    if (particle.userData.currentTween) {\r\n      particle.userData.currentTween.stop();\r\n      delete particle.userData.currentTween;\r\n    }\r\n  }\r\n  \r\n  /**\r\n   * æ‰¹é‡è·å–å¤šä¸ªç²’å­\r\n   * @param {number} count - éœ€è¦çš„ç²’å­æ•°é‡\r\n   * @returns {THREE.Mesh[]} ç²’å­æ•°ç»„\r\n   */\r\n  getParticles(count) {\r\n    const particles = [];\r\n    for (let i = 0; i < count; i++) {\r\n      particles.push(this.getParticle());\r\n    }\r\n    return particles;\r\n  }\r\n  \r\n  /**\r\n   * æ‰¹é‡é‡Šæ”¾å¤šä¸ªç²’å­\r\n   * @param {THREE.Mesh[]} particles - è¦é‡Šæ”¾çš„ç²’å­æ•°ç»„\r\n   */\r\n  releaseParticles(particles) {\r\n    particles.forEach(particle => this.releaseParticle(particle));\r\n  }\r\n  \r\n  /**\r\n   * æ¸…ç†æ‰€æœ‰æ´»è·ƒç²’å­\r\n   */\r\n  clearAll() {\r\n    console.log(`ParticlePool: æ¸…ç†æ‰€æœ‰æ´»è·ƒç²’å­ï¼Œæ•°é‡: ${this.activeParticles.length}`);\r\n    \r\n    // åœæ­¢æ‰€æœ‰ç²’å­çš„åŠ¨ç”»\r\n    this.activeParticles.forEach(particle => {\r\n      if (particle.userData.currentTween) {\r\n        particle.userData.currentTween.stop();\r\n        delete particle.userData.currentTween;\r\n      }\r\n      particle.visible = false;\r\n    });\r\n    \r\n    // å°†æ‰€æœ‰æ´»è·ƒç²’å­å½’è¿˜åˆ°æ± ä¸­\r\n    this.pool.push(...this.activeParticles);\r\n    this.activeParticles = [];\r\n  }\r\n  \r\n  /**\r\n   * è·å–å¯¹è±¡æ± çŠ¶æ€ä¿¡æ¯\r\n   * @returns {Object} çŠ¶æ€ä¿¡æ¯å¯¹è±¡\r\n   */\r\n  getStatus() {\r\n    return {\r\n      poolSize: this.pool.length,           // æ± ä¸­å¯ç”¨ç²’å­æ•°\r\n      activeCount: this.activeParticles.length,  // æ´»è·ƒç²’å­æ•°\